import { Themes, SolidFill, ColorRGBA, emptyFill } from '@lightningchart/lcjs'

export const TransparentCyberSpaceTheme = {
  ...Themes.darkGold, // base with no background texture
  // backgrounds → transparent
  chartBackgroundFillStyle: emptyFill,
  seriesBackgroundFillStyle: emptyFill,

  // optional: borrow CyberSpace example palettes for indicators etc.
  examples: {
    ...Themes.darkGold.examples,
    badGoodColorPalette: [...Themes.cyberSpace.examples.badGoodColorPalette],
  },
}
